import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Portfolio</h1>
      <ol>
        <li>title</li>
        <li>about</li>
        <li>experience</li>
        <li>stack and education</li>
        <li>projects</li>
      </ol>

      <p>load content on scroll</p>
      <h2>responsive</h2>
    </div>
  );
}

export default App;
